(62, 'product_management_card_sorting', 'survey', 'en_US', 'How do you create and edit products?', 'Have a say in the future of WooCommerce. Take part in a brief exercise and help us understand what information is important to you while editing products.', '{}', 'pending', 'woocommerce.com', '2023-05-31 16:17:03', NULL, 0, 'plain', '', 0, 0, 'info'),
(63, 'wc-refund-returns-page', 'info', 'en_US', 'Setup a Refund and Returns Policy page to boost your store\'s credibility.', 'We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.', '{}', 'unactioned', 'woocommerce-core', '2023-05-31 16:17:04', NULL, 0, 'plain', '', 0, 1, 'info'),
(64, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Connect to WooCommerce.com', 'Connect to get important product notifications and updates.', '{}', 'unactioned', 'woocommerce-admin', '2023-05-31 16:17:06', NULL, 0, 'plain', '', 0, 1, 'info'),
(65, 'wc-admin-selling-online-courses', 'marketing', 'en_US', 'Do you want to sell online courses?', 'Online courses are a great solution for any business that can teach a new skill. Since courses don’t require physical product development or shipping, they’re affordable, fast to create, and can generate passive income for years to come. In this article, we provide you more information about selling courses using WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2023-05-31 16:18:05', NULL, 0, 'plain', '', 0, 1, 'info'),
(66, 'storefront-customize', 'info', 'en_US', 'Design your store with Storefront 🎨', 'Visit the Storefront settings page to start setup and customization of your shop.', '{}', 'unactioned', 'storefront', '2023-06-01 04:06:34', NULL, 0, 'plain', '', 0, 0, 'info'),
(67, 'wc-admin-orders-milestone', 'info', 'en_US', 'First order received', 'Congratulations on getting your first order! Now is a great time to learn how to manage your orders.', '{\"current_milestone\":1}', 'unactioned', 'woocommerce-admin', '2023-06-01 07:18:04', NULL, 0, 'plain', '', 0, 0, 'info'),
(69, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Choosing a theme?', 'Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.', '{}', 'unactioned', 'woocommerce-admin', '2023-06-04 11:32:49', NULL, 0, 'plain', '', 0, 0, 'info'),
(70, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'How to customize your product catalog', 'You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.', '{}', 'unactioned', 'woocommerce-admin', '2023-06-04 11:32:49', NULL, 0, 'plain', '', 0, 0, 'info'),
(71, 'wc-admin-launch-checklist', 'info', 'en_US', 'Ready to launch your store?', 'To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.', '{}', 'unactioned', 'woocommerce-admin', '2023-06-04 11:32:49', NULL, 0, 'plain', '', 0, 1, 'info'),
(72, 'wc-admin-mobile-app', 'info', 'en_US', 'Install Woo mobile app', 'Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.', '{}', 'unactioned', 'woocommerce-admin', '2023-06-04 11:32:49', NULL, 0, 'plain', '', 0, 0, 'info'),
(73, 'wc-admin-woocommerce-subscriptions', 'marketing', 'en_US', 'Do you need more info about WooCommerce Subscriptions?', 'WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.', '{}', 'unactioned', 'woocommerce-admin', '2023-06-04 11:32:49', NULL, 0, 'plain', '', 0, 0, 'info'),
(74, 'woocommerce-WCstripe-May-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Stripe plugin', '<strong>Your store requires a security update for the WooCommerce Stripe plugin</strong>. Please update the WooCommerce Stripe plugin immediately to address a potential vulnerability.', '{}', 'pending', 'woocommerce.com', '2023-06-04 11:32:52', NULL, 0, 'plain', '', 0, 0, 'info'),
(75, 'woocommerce-WCReturnsWarranty-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Returns and Warranty Requests extension', '<strong>Your store requires a security update for the Returns and Warranty Requests extension</strong>.  Please update to the latest version of the WooCommerce Returns and Warranty Requests extension immediately to address a potential vulnerability discovered on May 31.', '{}', 'pending', 'woocommerce.com', '2023-06-04 11:32:52', NULL, 0, 'plain', '', 0, 0, 'info');
